import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="app-header">
        <h1>RACESENSE</h1>
        <div className="button-row">
          <button className="menu-btn">Circuiti</button>
          <button className="menu-btn">Piloti</button>
          <button className="menu-btn">Campionati</button>
        </div>
        <button className="race-btn">GARA</button>
      </header>
    </div>
  );
}

export default App;
